import React from "react";

function CustomClue({ clue }) {
  if (typeof clue === "string" && clue.startsWith("img:")) {
    const src = clue.replace("img:", "");
    return (
      <img src={src} alt="Clue" style={{ width: "100px", height: "auto" }} />
    );
  }

  return <span>{clue}</span>;
}

export default CustomClue;
